import React from 'react';
import './index.css'
const Projects = () => {
    const projects = [
        { title: 'Portfolio Website', description: 'A modern portfolio website built with React.' },
        { title: 'Travel Planner', description: ' The Travel Planner App is a web application designed to help users plan their trips efficiently. It allows users to create personalized travel itineraries by selecting destinations, accommodation, activities, and restaurants.' },
        { title: 'FoodHub App', description: 'The Food HUB App is an online platform designed to help users discover, order, and explore a wide variety of food from local restaurants.' }
    ];

    return (
        <section id="projects" className="projects">
            <h2>My Projects</h2>
            <div className="project-cards">
                {projects.map((project, index) => (
                    <div key={index} className="project-card">
                        <h3>{project.title}</h3>
                        <p>{project.description}</p>
                    </div>
                ))}
            </div>
        </section>
    );
};

export default Projects;
